CREATE DEFINER=`root`@`localhost` PROCEDURE `categoryGenerator`(IN input VARCHAR(255))
BEGIN
	-- if input is a song
    SELECT artists.artistName as CategoryName,"song" as Input, "artist" as Categories
    FROM musearch.artists
	JOIN musearch.albums ON albums.artistId = artists.id
    JOIN musearch.songs ON songs.AlbumId = albums.albumId
    WHERE songs.songName LIKE input
    UNION 
    SELECT albums.albumName as CategoryName,"song" as Input, "album" as Categories
    FROM musearch.albums
	JOIN musearch.songs ON songs.AlbumId = albums.albumId
    WHERE songs.songName LIKE input
    UNION 
    SELECT (songs.yearReleased) - songs.yearReleased % 10 as CategoryName,"song" as Input, "decade" as Categories
    FROM musearch.songs
	WHERE songs.songName LIKE input AND songs.yearReleased not like "0"
    -- if input is an artist
    UNION
    SELECT artists.artistName as CategoryName,"song" as Input, "artist" as Categories
    FROM musearch.artists
    WHERE artists.artistName LIKE input
    UNION
    SELECT albums.albumName as CategoryName,"artist" as Input, "album" as Categories
    FROM musearch.albums
    JOIN musearch.artists ON albums.artistId = artists.id
	WHERE artists.artistName LIKE input
    UNION 
    SELECT ((albums.yearReleased) - albums.yearReleased % 10) as CategoryName,"artist" as Input, "year" as Categories
    FROM musearch.albums
    JOIN musearch.artists ON albums.artistId = artists.id
	WHERE artists.artistName LIKE input AND albums.yearReleased not like "0"
    UNION 
    -- if input is an album
    SELECT artists.ArtistName as CategoryName,"album" as Input, "artist" as Categories
    FROM musearch.artists
    JOIN musearch.albums ON albums.artistId = artists.id
	WHERE albums.albumName LIKE input
    UNION
    SELECT albums.albumName as CategoryName,"album" as Input, "album" as Categories
    FROM musearch.albums
	WHERE albums.AlbumName LIKE input
    UNION 
    SELECT ((albums.yearReleased) - albums.yearReleased % 10) as CategoryName,"album" as Input, "decade" as Categories
    FROM musearch.albums
	WHERE albums.AlbumName LIKE input AND albums.yearReleased not like "0"
    ;
END ;;
DELIMITER ;
